import 'bootstrap/dist/css/bootstrap.min.css';
import { over } from 'lodash-es';
import React, {useState,useEffect} from 'react'
import { Dropdown } from 'react-bootstrap';
import styled from 'styled-components';
//import { DropDownList } from "@progress/kendo-react-dropdowns";
//import { Dropdown } from 'semantic-ui-react'
function DropdownExampleSearchSelection(){

  const [overview,setOverview]=useState(["CSK"]);
    useEffect(() => {
      fetch("/api/getTeams").then(resp => resp.json())
      .then(res => 
        setOverview(res.team))
    }, [])

  return(
    <Drop>
      <Drop.Toggle variant="success" id="dropdown-basic">
        Select Team
      </Drop.Toggle>
      {overview.map(over => (
      <Drop.Menu>
          <Drop.Item href="">{over}</Drop.Item>
      </Drop.Menu>
      ))}
    </Drop>
  )
}

const Drop = styled.Dropdown`
    padding: 0 2rem;
    display: flex;
    justify-content:space-between;
    align-items:center;
    flex-wrap: wrap;
    background: white;
`;

export default DropdownExampleSearchSelection
